import React, {useState} from 'react';
import { TextField, Button, Container, Stack } from '@mui/material';
import { Link } from "react-router-dom"
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Select, { SelectChangeEvent } from '@mui/material/Select';

const ProductForm = () => {
    const [productName, setproductName] = useState('')
    const [category, setcategory] = useState('')
    const [base, setbase] = useState('')
    const [price, setprice] = useState('')
    const [where, setwhere] = useState('')
    const [siteurl, setsiteurl] = useState('')
    const [imageurl, setimageurl] = useState('')
    const [corecount, setcorecount] = useState('')
    const [tdp, settdp] = useState('')
    const [coreclock, setcoreclock] = useState('')
    const [graphic, setgraphic] = useState('')



    function handleSubmit(event) {
        event.preventDefault();
      //  console.log(firstName, lastName, email, dateOfBirth, password) 
    }
    const handleChange = (event) => {
        setcategory(event.target.value);
      };

    return (
        <React.Fragment>
            <h2>Product Form</h2>
            <form onSubmit={handleSubmit} action={<Link to="/homepage" />}>
            <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Product Name"
                        onChange={e => setproductName(e.target.value)}
                        value={productName}
                        fullWidth
                        required
                    />
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Merchant "
                        onChange={e => setwhere(e.target.value)}
                        value={where}
                        fullWidth
                        required
                    />
                </Stack>
                <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Base "
                        onChange={e => setbase(e.target.value)}
                        value={base}
                        fullWidth
                        required
                    />
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Price "
                        onChange={e => setprice(e.target.value)}
                        value={price}
                        fullWidth
                        required
                    />
                </Stack>               
                <TextField
                    type="url"
                    variant='outlined'
                    color='secondary'
                    label="Site URL"
                    onChange={e => setsiteurl(e.target.value)}
                    value={siteurl}
                    fullWidth
                    required
                    sx={{mb: 4}}
                />
                <TextField
                    type="url"
                    variant='outlined'
                    color='secondary'
                    label="Image URL"
                    onChange={e => setimageurl(e.target.value)}
                    value={imageurl}
                    required
                    fullWidth
                    sx={{mb: 4}}
                />
         <InputLabel> Category</InputLabel>
        <Select
          value={category}
          onChange={handleChange}
          autoWidth
          label="Cateogory"
        >
          <MenuItem value={'CPU'}>CPU</MenuItem>
          <MenuItem value={'CPU Cooler'}>CPU Cooler</MenuItem>
          <MenuItem value={'Motherboard'}>Motherboard</MenuItem>
          <MenuItem value={'Memory'}>Memory</MenuItem>
          <MenuItem value={'Storage'}>Storage</MenuItem>
          <MenuItem value={'Video Card'}>Video Card</MenuItem> 
          <MenuItem value={'Power Supplies'}>Power Supplies</MenuItem>
          <MenuItem value={'Cases'}>Cases</MenuItem>
          <MenuItem value={'Peripherals'}>Peripherals</MenuItem>  
          <MenuItem value={'Accessories'}>Accessories</MenuItem>                     

        </Select>

        {category === 'CPU' &&
            (
                <form>               
                <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                        <TextField
                            type="text"
                            variant='outlined'
                            color='secondary'
                            label="Core Count"
                            onChange={e => setcorecount(e.target.value)}
                            value={corecount}
                            fullWidth
                            required
                        />
                        <TextField
                            type="text"
                            variant='outlined'
                            color='secondary'
                            label="TDP"
                            onChange={e => settdp(e.target.value)}
                            value={tdp}
                            fullWidth
                            required
                        />
                    </Stack>
                    <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                        <TextField
                            type="text"
                            variant='outlined'
                            color='secondary'
                            label="Performance Core Clock"
                            onChange={e => setcoreclock(e.target.value)}
                            value={coreclock}
                            fullWidth
                            required
                        />
                        <TextField
                            type="text"
                            variant='outlined'
                            color='secondary'
                            label="Integrated Graphic"
                            onChange={e => setgraphic(e.target.value)}
                            value={graphic}
                            fullWidth
                            required
                        />
                    </Stack>              

                </form> 
            )
            }
        {category === 'Memory' && <h1>It works???</h1>}


                <Button variant="outlined" color="secondary" type="submit">Post</Button>

            </form>     
        </React.Fragment>
    )
}

export default ProductForm;
